//定义参数结构体
typedef struct
{
	GUI_AUTODEV_INFO AutoDevInfo;
	GUI_POINT aPoints[7];
	float Angle;
}PARAM;
// 定义位图信息 
static const GUI_BITMAP bmScaleR140 = {
	200,
	73,
	100,
	4,
	acScaleR140,
	&PalScaleR140
};
//图形坐标
static const GUI_POINT _aNeedle[] = {
  { MAG * ( 0), MAG * (  0 + 125) },
  { MAG * (-3), MAG * (-15 + 125) },
  { MAG * (-3), MAG * (-65 + 125) },
  { MAG * ( 3), MAG * (-65 + 125) },
  { MAG * ( 3), MAG * (-15 + 125) },
};
static float _GetAngle(int tDiff)//0-24000 angle limit is 225
{
	if (tDiff < 15000) {
   return  225 - 0.006 * tDiff ;
  }
  tDiff -= 15000;
  if (tDiff < 7500) {
    return  225 - 90 + 0.012 * tDiff ;
  }
  return 225;
}
static void _Draw(void *p)
{
	PARAM *pParam;
	
	pParam = (PARAM *)p;
	
	if(pParam->AutoDevInfo.DrawFixed){//如果绘制所有项目
		GUI_ClearRect(20,80+bmScaleR140.YSize,20+bmScaleR140.XSize-1,180);
		GUI_DrawBitmap(&bmScaleR140,20,80);
	}
	GUI_SetColor(GUI_WHITE);
	GUI_AA_FillPolygon(pParam->aPoints,countof(_aNeedle),MAG*120,MAG*220);
	if(pParam->AutoDevInfo.DrawFixed){
		GUI_SetTextMode(GUI_TM_TRANS);
		GUI_SetColor(GUI_RED);
		GUI_SetFont(&GUI_Font24B_ASCII);
		GUI_DispStringHCenterAt("RPM/1000",120,140);
	}
}
void memdisplay(void)
{
	GUI_AUTODEV AutoDev;
	PARAM Param;//其中包含了gui_autodev_info 参数
	int Cnt,tDiff,t0;
	
	GUI_SetBkColor(GUI_BLACK);
  GUI_Clear();
  GUI_SetColor(GUI_WHITE);
  GUI_SetFont(&GUI_Font24_ASCII);
  GUI_DispStringHCenterAt("MEMDEV_AutoDev ", 120, 5);
  GUI_SetFont(&GUI_Font8x16);
  GUI_DispStringHCenterAt("Scale using GUI_AUTODEV", 120, 50);
	
	GUI_AA_EnableHiRes();//启用高分辨率坐标
  GUI_AA_SetFactor(MAG);//设置抗锯齿质量因子
	
	while(1)
	{
		t0 = GUI_GetTime();
		GUI_MEMDEV_CreateAuto(&AutoDev);
		
		for(Cnt = 0; (tDiff = GUI_GetTime()-t0) < 24000;Cnt++)
		{
			Param.Angle = _GetAngle(tDiff)*DEG2RAD;//弧度，角度转化公式
			GUI_RotatePolygon(Param.aPoints,_aNeedle,countof(_aNeedle),Param.Angle);
			GUI_MEMDEV_DrawAuto(&AutoDev,&Param.AutoDevInfo,&_Draw,&Param);
		}
		GUI_SetColor(GUI_WHITE);
    GUI_SetFont(&GUI_Font8x16);
    GUI_DispStringHCenterAt("Milliseconds/picture:", 120, 200);
    GUI_SetTextAlign(GUI_TA_CENTER);
    GUI_SetTextMode(GUI_TM_NORMAL);
    GUI_DispNextLine();
    GUI_GotoX(120);
    GUI_DispFloatMin((float)tDiff / (float)Cnt, 2);
		
		GUI_MEMDEV_DeleteAuto(&AutoDev);
    delay_ms(3000);
    GUI_ClearRect(0, 70, 239, 319);
	}

}

int main(void)
{
	BSP_Init();
//	main_ui();
memdisplay();

	OSInit();
	OSTaskCreate(start_task,(void *)0,(OS_STK *)&START_TASK_STK[START_STK_SIZE-1],START_TASK_PRIO);//创建起始任务
	OSStart();
}
void start_task(void *pdata)
{
	OS_CPU_SR cpu_sr = 0;

//	GUI_Delay(1000);
	OS_ENTER_CRITICAL();
	OSTaskCreate(emwin_demo_task,(void *)0,&EMWIN_TASK_STK[EMWIN_STK_SIZE-1],EMWIN_DEMO_TASK_PRIO);
	OSTaskCreate(touch_task,(void *)0,&TOUCH_TASK_STK[TOUCH_STK_SIZE-1],TOUCH_TASK_PRIO);
	OSTaskCreate(led_task,(void *)0,(OS_STK*)&LED_TASK_STK[LED_STK_SIZE-1],LED_TASK_PRIO);
	OSTaskSuspend(START_TASK_PRIO);	//挂起起始任务.
	OS_EXIT_CRITICAL();
}
